func TestProfile_Get(t *testing.T) {
	type args struct {
		ctx context.Context
	}

	type test struct {
		fields  profileFields
		args    args
		want    *presentations.ProfileResponse
		wantErr error
	}

	tests := map[string]func(t *testing.T, ctrl *gomock.Controller) test{
		"Given valid request of Get Profile, When repository executed successfully, Return no error": func(t *testing.T, ctrl *gomock.Controller) test {

			ctx := context.Background()

			userID := int64(1)
			dateNow := time.Now()

			ctx = context.WithValue(ctx, consts.CtxAuthInfo, jwt.MapClaims{
				"authorized":  true,
				"dtid":        uuid.New().String(),
				"expiry_time": dateNow,
				"user_id":     userID,
			})

			args := args{
				ctx: ctx,
			}

			cfg := di.GetConfig()

			mockUserRepo := repository.NewGoMockUserRepo(ctrl)

			mockUser := repository.User{
				ID:        1,
				FirstName: "Yoni",
				LastName:  "Saka",
				Email:     "yonisaka0@gmail.com",
				Phone:     "08123456789",
				Password:  "5e884898da28047151d0e56f8dc6292773603d0d6aabbdd62a11ef721d1542d8",
				Dob:       &dateNow,
				Gender:    consts.Man,
			}

			mockUserRepo.EXPECT().FindByID(args.ctx, userID).Return(&mockUser, nil)

			mockUserSubscriptionRepo := repository.NewGoMockUserSubscriptionRepo(ctrl)

			expiredAt := time.Now().AddDate(1, 0, 0)
			mockUserSubscription := repository.UserSubscription{
				ID:               1,
				UserID:           1,
				SubscriptionCode: "77aec485-5196-4974-90a6-d0831eb72c8c",
				ExpiredAt:        &expiredAt,
			}

			mockUserSubscriptionRepo.EXPECT().FindByUserID(args.ctx, userID).Return(&mockUserSubscription, nil)

			mockUserImageRepo := repository.NewGoMockUserImageRepo(ctrl)

			mockUserImages := []repository.UserImage{
				{
					ID:       1,
					UserID:   1,
					ImageURL: "77aec485-5196-4974-90a6-d0831eb72c8c",
				},
			}

			mockUserImageRepo.EXPECT().FindByUserID(args.ctx, userID).Return(mockUserImages, nil).AnyTimes()

			mockStorage := storage.NewGoMockStorage(ctrl)

			mockURL := url.URL{
				Scheme: "https",
				Host:   "cloudinary.com",
				Path:   "image",
			}

			mockStorage.EXPECT().GetSignedURL(cfg.Cloudinary.Bucket, mockUserImages[0].ImageURL).Return(&mockURL, nil)

			want := presentations.ProfileResponse{
				FirstName: mockUser.FirstName,
				LastName:  mockUser.LastName,
				Status:    consts.Verified,
				Email:     mockUser.Email,
				Phone:     mockUser.Phone,
				Dob:       mockUser.Dob.Format(time.DateTime),
				Gender:    mockUser.Gender,
				Intend:    mockUser.Intend,
				Images:    []string{mockURL.String()},
			}

			return test{
				fields: profileFields{
					cfg:                  cfg,
					userRepo:             mockUserRepo,
					userSubscriptionRepo: mockUserSubscriptionRepo,
					userImageRepo:        mockUserImageRepo,
					storage:              mockStorage,
				},
				args:    args,
				want:    &want,
				wantErr: nil,
			}
		},
	}

	for name, testFn := range tests {

		t.Run(name, func(t *testing.T) {
			ctrl := gomock.NewController(t)
			defer ctrl.Finish()

			tt := testFn(t, ctrl)

			sut := profileSut(tt.fields)

			got, err := sut.GetProfile(tt.args.ctx)
			if tt.wantErr != nil {
				assert.ErrorIs(t, err, tt.wantErr)
			} else {
				assert.NoError(t, err)
			}

			assert.Equal(t, tt.want, got)
		})
	}
}

func TestProfile_UploadImages(t *testing.T) {
	type args struct {
		ctx context.Context
		req presentations.UploadImageRequest
	}

	type test struct {
		fields  profileFields
		args    args
		wantErr error
	}

	tests := map[string]func(t *testing.T, ctrl *gomock.Controller) test{
		"Given valid request of Profile Upload Images, When repository executed successfully, Return no error": func(t *testing.T, ctrl *gomock.Controller) test {

			ctx := context.Background()

			userID := int64(1)
			dateNow := time.Now()

			cfg := di.GetConfig()

			ctx = context.WithValue(ctx, consts.CtxAuthInfo, jwt.MapClaims{
				"authorized":  true,
				"dtid":        uuid.New().String(),
				"expiry_time": dateNow,
				"user_id":     userID,
			})

			args := args{
				ctx: ctx,
				req: presentations.UploadImageRequest{
					Images: []string{getBase64Image()},
				},
			}

			mockStorage := storage.NewGoMockStorage(ctrl)

			mockStorage.EXPECT().Put(ctx, cfg.Cloudinary.Bucket, gomock.Any(), gomock.Any(), false, consts.ExtJpeg).Return(nil).AnyTimes()

			mockUserImageRepo := repository.NewGoMockUserImageRepo(ctrl)

			mockUserImageRepo.EXPECT().StoreBulk(ctx, gomock.Any()).Return(nil)

			return test{
				fields: profileFields{
					cfg:           cfg,
					storage:       mockStorage,
					userImageRepo: mockUserImageRepo,
				},
				args:    args,
				wantErr: nil,
			}
		},
	}

	for name, testFn := range tests {

		t.Run(name, func(t *testing.T) {
			ctrl := gomock.NewController(t)
			defer ctrl.Finish()

			tt := testFn(t, ctrl)

			sut := profileSut(tt.fields)

			err := sut.UploadImages(tt.args.ctx, tt.args.req)
			if tt.wantErr != nil {
				assert.ErrorIs(t, err, tt.wantErr)
			} else {
				assert.NoError(t, err)
			}
		})
	}
}

